import React from 'react'
import Question from 'react'

const QuestionsContainer = (props) => {

    const { questions } = props

    return (
        <div>
            {questions.map(
                (question, index) => {
                    <Question key={index} />
                }
            )}
        </div>
    )
}

export default QuestionsContainer
